import React from 'react'

function Article(props) {
  return (
    <div>
    {props.map(article => {
        return (
          <div key={article.id}>
               <h2>{article.title}</h2>
               <p>{article.description}</p>
          </div>

        )
      })}
    </div>
  )
}

export default Article
